import React from 'react';
import application from '../src/images/application.svg';
import website from '../src/images/website.svg';
import software from '../src/images/software.svg';
import enterprise from '../src/images/enterprise.svg';
import ai from '../src/images/ai.svg';
import marketing from '../src/images/marketing.svg';

const Sdata = [
    {
        imgsrc: application,
        title: 'Mobile Application Development Services',
        content: 'Talented pool of developers experienced in building mHealth apps, mobile payment apps, and m-commerce apps'
    },
    {
        imgsrc: website,
        title: 'Website Development Services',
        content: 'Make solutions that accelerate workflows, optimize operations and boost revenues'
    },{
        imgsrc: software,
        title: 'Software Development Services',
        content: ''
    },{
        imgsrc: ai,
        title: 'AI/ML Development Services',
        content: ''
    },{
        imgsrc: enterprise,
        title: 'Enterprise Application Development Services',
        content: ''
    },{
        imgsrc: marketing,
        title: 'Digital Marketing Services',
        content: ''
    }
]

export default Sdata;
